import React from "react";
import {getTr} from "../actions/tr.action";
import TableHead from "@material-ui/core/TableHead/TableHead";
import TableRow from "@material-ui/core/TableRow/TableRow";
import TableCell from "@material-ui/core/TableCell/TableCell";
import Table from "@material-ui/core/Table/Table";
import TableBody from "@material-ui/core/TableBody/TableBody";
import {useDispatch, useSelector} from "react-redux";
import Button from "@material-ui/core/Button/Button";
import {makeStyles} from "@material-ui/core";


const useStyles = makeStyles({
    table: {
        minWidth: 650,
    },
});

const AdminTr = () => {

    const classes = useStyles();

    const dispatch = useDispatch();

    const adminTrState = useSelector(appState => {
        return {
            tr: appState.tr
        };
    });


    const getUnhandledTr = (event) => {
        event.preventDefault();
        dispatch(getTr());

    };


    return (
        <div>
            <Button onClick = {getUnhandledTr}>Show unhandled tour reservations</Button>
            <Table className={classes.table} aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <TableCell>First Name</TableCell>
                            <TableCell align="right">Last Name</TableCell>
                            <TableCell align="right">Email</TableCell>
                            <TableCell align="right">Phone</TableCell>
                            <TableCell align="right">SMS</TableCell>
                            <TableCell align="right">Time</TableCell>
                            <TableCell align="right">Date</TableCell>
                            <TableCell align="right">Status</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {
                            adminTrState.tr ?
                                adminTrState.tr.map((element) => (
                                    <TableRow key={element.id}>
                                        <TableCell component="th" scope="row">
                                            {element.firstname}
                                        </TableCell>
                                        <TableCell align="right">{element.lastname}</TableCell>
                                        <TableCell align="right">{element.email}</TableCell>
                                        <TableCell align="right">{element.phone}</TableCell>
                                        <TableCell align="right">{element.sms}</TableCell>
                                        <TableCell align="right">{element.time}</TableCell>
                                        <TableCell align="right">{element.date}</TableCell>
                                        <TableCell align="right">{element.status}</TableCell>
                                    </TableRow>
                                ))
                                :
                                <span></span>
                        }
                    </TableBody>
                </Table>
        </div>
    );

}

export default AdminTr;
